description:
It's New Year's Eve and Phoenix is throwing a party for the night or rather she was. No one showed up to her party and she's really upset about it. Pete tries to console her and tells her that at least, they can bring the new year in with a bang. Phoenix's friend Sienna comes downstairs after finally picking out her outfit for the night. They check the time and it is a minute till midnight and only the three of them to celebrate. Well, it looks like the three of them will be banging out of this year and into the new one!


